import React, { useEffect, useState } from "react";

function GetMath() {
  const [items, setItems] = useState([]);

  useEffect(() => {}, []);

  return (
    <div>
      <ul>
        <button onClick={getData}>Get Data</button>
        {JSON.stringify(items)}
        {items.map((item) => (
          <li key={item.id}>{item.value}</li>
        ))}
      </ul>
    </div>
  );
}

export default GetMath;
